// ./src/pages/index.js

const rocket = {
    textAlign: "center",
    "& img": {
        width: "630px",
    }
};

function Index() {
    return (
        <section style={rocket} className="section__index" >
            <img src="https://media.giphy.com/media/QbumCX9HFFDQA/giphy.gif" />
        </section>
    );
}

export default Index;
